import React, { useState } from 'react'
import Layouts from '../Layouts/Layouts'

import HomeIcons from '../Components/HomeIcons';
import { useLocation } from 'react-router-dom';
import homeData from '../utility/HomData';
function Home() {  
  const location = useLocation();
  const [homeDatas,setHomedatas] = useState();
  const getHomeData = ()=>{
    const {pathname} = location;

    if(pathname.startsWith('/Home'))
    {
      setHomedatas(homeData);
    }
    else if(pathname.startsWith('/s'))
    {
      homeData.fil
    }
  }

  return (
    <Layouts>
      <div className='grid grid-cols-1 lg:grid-col-3 md:grid-cols-4 items-center justify-between gap-10 p-10' style={{ zIndex: 0 }}>
        {homeDatas.map((data, key) => (
          <div key={key}>
            <HomeIcons src={data.src} title={data.title} toRoute={data.toRoute} />
          </div>
        ))}
      </div>
    </Layouts>
  )
}

export default Home;
